pragma solidity ^0.4.23;

import "zeppelin-solidity/contracts/math/SafeMath.sol";

library VotePayout { 
    using SafeMath for uint256;

    function calcFraction(uint256 _value, uint _numerator, uint _denom) public pure returns (uint256 _result) { 
        if(_numerator == 0) {
            return 0;
        }
        else if (_numerator == _denom)  {
            return _value;
        }

        return _value.mul(_numerator).div(_denom);
    }

    function percent(uint numerator, uint denominator, uint precision) public pure returns(uint quotient) {

         // caution, check safe-to-multiply here
        uint _numerator  = numerator * 10 ** (precision + 1);
        // with rounding of last digit
        uint _quotient = ((_numerator / denominator) + 5) / 10;
        return ( _quotient);
    }

}
